import React,{useState} from 'react'
import { useDispatch } from 'react-redux'
import { removeItem } from './reducers/CartSlice';


const CartItem = (props) => {

  const dispatch = useDispatch();

  const handleClick = (item)=>{
      dispatch(removeItem(item));
  }

  const [count,setCount] = useState(props.data.count);

  const decCount = ()=>{
    setCount(count-1);
  }

  const incCount = ()=>{
    setCount(count+1);
  }

  return (
    <div>
      <div className='flex'>
          <img className='w-40 m-2' src={props.data.pageData.images}/>
          <div>
            <h1 className='font-bold text-xl font-serif my-4'>{props.data.pageData.title}</h1>
            <h1 className='font-bold text-lg my-3'>Size: {props.data.size}</h1>

            <div className='flex justify-between align-middle'>
              <div>
                    <button className='px-3 text-2xl bg-gray-500 font-bold' onClick={decCount}>-</button>

                    <span className='p-2 font-bold'>{count}</span>

                    <button className='px-2 text-2xl bg-gray-500 font-bold' onClick={incCount}>+</button>
              </div>

              <h1 className='my-3 font-semibold text-xl'>Rs. {props.data.pageData.price/100}</h1>
              
            </div>
            <button className='p-2' onClick={()=>handleClick(props.data.pageData)}></button>
            </div>
      </div>
      <hr className='m-2'></hr>
    </div>
  )
}

export default CartItem
